import React from 'react';

function VideoPreviewComponent({ processedFramePath }) {
  return (
    <div className="video-preview-component">
      <h2>Preview</h2>
      {processedFramePath ? (
        <img src={`http://localhost:5000/${processedFramePath}`} alt="Processed Frame" />
      ) : (
        <p>No processed frame available.</p>
      )}
    </div>
  );
}


export default VideoPreviewComponent;
